¿Cuál es la trayectoria política de Jorge Álvarez Máynez?

@alvarezmaynez fue regidor en Zacatecas, diputado local y federal; en 2013 se unió a @movciudadanomx en donde, entre otros puestos, fue secretario General de Acuerdos. El gobernador de Nuevo León, @samuelgarcias, le entregó la estafeta y ahora será Máynez quien buscará la Presidencia de la República en las elecciones de junio.

