#PMX2024 | ¿Cuál de los aspirantes presidenciales tiene más estudios?

@claudia_shein, precandidata de Morena-PT-PVEM, es licenciada en Física, maestra en Ingeniería Energética y Doctora en Ingeniería Ambiental. La abanderada del PRI-PAN-PRD, @xochitlgalvez, cuenta con una ingeniería en Computación y especialidades en robótica, inteligencia artificial y más. Mientras que @alvarezmaynez, de @movciudadanomx, tiene una licenciatura y dos maestrías en Administración Pública y Políticas Públicas, así como en Derecho Constitucional y Derechos Humanos.

