#Noticias:

Este viernes la precandidata de Morena, Claudia Sheinbaum Pardo (
@Claudiashein
), encabezó un evento con mujeres militantes y simpatizantes llamado "Es tiempo de nosotras", que se celebró en el Parque Bicentenario, poco antes del mediodía. 

Frente a un nutrido grupo de asistentes e invitadas, entre las que se encontraban Ernestina Godoy, Citlalli Hernández Mora y Olga Sánchez Cordero, entre otras; Sheinbaum reiteró que la lucha de las mujeres "no es individual, sino colectiva", por lo que afirmó: "a la presidencia no llega una, llegamos todas".

